import './App.css';
import { Route, BrowserRouter, Switch} from "react-router-dom"; 
import { Header, Footer } from './component';
import routes from './config/routes';

const App = () => {
  return (
    <BrowserRouter>
      <div className="App">
        <div>
          <Header />
        </div>
          <Switch>
            {routes.map((route) => {
              if (route.isPublic) {
                return (
                  <Route
                    path={route.path}
                    component={route.component}
                    key={route.path}
                  />
                )
              }
            })}
          </Switch>
        <div>
          <Footer />
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
